import "../css/NavBarBottom.css"

const NavbarBottom = () => {
    return (
    <div className="navbarBottom">

        <div className="navbar-center">
            <a href="#">Contatez nous!</a>
            <a href="#">Mentions légales</a>
            <a href="#">Politiques de confidentialités</a>
        </div>

    </div>
);
};
export default NavbarBottom;
